script: |
  super -f text -I q543.spq | sort > q543.out

inputs:
  - name: q543.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 * - ( - col0 ) * + col1 NOT IN ( + + col0 * 43 - col0, col2 );
  - name: tab2

outputs:
  - name: q543.out
    data: |
      46	51	23
      64	77	40
      75	67	58
